            <h2 id="quadro-de-servidores-GETapi-estagiarios">Listar estagiários ativos</h2>

<p>
</p>

<p>Retorna todos os estagiário ativos.
Faça a busca por departamento usando o parâmetro codset. Ex: api/estagiarios?codset=599</p>

<span id="example-requests-GETapi-estagiarios">
<blockquote>Example request:</blockquote>


<div class="bash-example">
    <pre><code class="language-bash">curl --request GET \
    --get "http://127.0.0.1:8000/api/estagiarios" \
    --header "Content-Type: application/json" \
    --header "Accept: application/json" \
    --data "{
    \"codset\": 6
}"
</code></pre></div>


<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "http://127.0.0.1:8000/api/estagiarios"
);

const headers = {
    "Content-Type": "application/json",
    "Accept": "application/json",
};

let body = {
    "codset": 6
};

fetch(url, {
    method: "GET",
    headers,
    body: JSON.stringify(body),
}).then(response =&gt; response.json());</code></pre></div>

</span>

